const TuitStats = ({tuit, likeTuit}) => {
  return (
    <div className="row">
      ...
      <div className="col">
        <span onClick={() => likeTuit(tuit)}>
        {
          tuit.stats.likes > 0 &&
          <i className="fa-solid fa-thumbs-up"
             style={{color: 'red'}}></i>

        }
        {
          tuit.stats.likes <= 0 &&
          <i className="far fa-thumbs-up"></i>
        }
        {tuit.stats && tuit.stats.likes}
        </span>
      </div>
       ...
    </div>
  );
}
export default TuitStats;
